import { useState } from 'react';
import './App.css';
import { Math1 } from './features/math1/Math1';

function App() {
  const [path, setPath] = useState('math1');
  const renderBody = () => {
    switch(path) {
      case 'math1':
        return <Math1 />;
      default:
        return null;
    }
  }
  return (
    <div className="App">
      <header className="App-body">
        <ul onClick={() => setPath('math1')}>Add/Subtract Within 10 Practice</ul>
      </header>
      <body className="App-body">
        {renderBody()}
      </body>
    </div>
  );
}

export default App;
